Providing a file with the following contents using the -c option to shaunch will open up a terminal ui (utilizing fzf) showing all commands. By selecting a command, its markdown help will be rendered in the terminal. By htting Enter the exec and prompt parameters will be executed/displayed if given. [ { // caption is what will be shown as command title "caption": "Mount", // help for this command will be evaluated by executing script ./docs/mount.md.sh // the script is expected to return markdown "help": "./docs/mount.md.sh", // the exec content will be executed within shaunch. after exiting the script the shaunch ui will appear again "exec": "echo 'mounted'
Press any key to continue ...'; read -n 1" }, { "caption": "Status", // help for this command will be rendered from a markdown file "help": "./docs/status.md" // this command looks nonsense without `exec` nor `prompt` but ... the markdown will be subsituted by bash before rendering // that means any `$(...)`/$VARIABLE expression will be replaced by the computed value // example : if your markdown contains `$(uname -a)` it will be rendered as whatever `uname -a` returns on your machine }, { "caption": "Exit", // help for this command is inline markdown "help": "# Exit

Quits the program", // exec contains a function call exported by shaunch forcing shaunch to exit when this command gets trigged (by hitting `Enter`) "exec": "shaunch: exit" }, { "caption": "Backup", "help": "# Backup

starts the backup.

Hit enter to copy the command to the next prompt", // if this action gets trigegred, the prompt value will be written after the next terminal prompt so that the user can decide if he wahts to execute the command by manually confirm with `Enter` in the terminal "prompt": "./backup.sh" }
]
